let nbind = require(`nbind`);

let binding = nbind.init(__dirname);
let lib = binding.lib;

binding.bind(`ObjA`, class ObjA {

    constructor(a = 0, b = 0) {

        this.a = a;
        this.b = b;

    }

    fromJS(output) {

        output(this.a, this.b);

    }

    log() {

        console.log(this.a, this.b);

    }

});

let test = new lib.TestA();
let obj = test.test();

console.log(obj.log);

exports.TestA = lib.TestA;
